import React from 'react';

//* We are given a props object, which is then destructured
const Recipe = ({title,calories,image,ingredients}) => {
    return (
        <div>
            <h1> {title} </h1>
            <p> {calories} </p>
            <ol>
                {ingredients.forEach(ingredient => {
                  <li> {ingredient} </li>  
                })}
            </ol>
            <img src={image} alt=""/>
        </div>
    )
}
export default Recipe;
